import React, { Component } from 'react'
import "./no_of_sem.css"

class no_of_sem extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             sems: ""
        }
    }
    
    render() {
        return (
            <form >
                <div className="title">
                    <label >
                        <h3>Number of Semesters:</h3>
                    </label>
                    <input type="text" value={this.state.sems} onChange />
                </div>
            </form>
        )
    }
}

export default no_of_sem
